	add("archaeography", "{\"term\":\"archaeography\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Formed as {{affix|en|archae-|-o-|-graphy}}, after the Ancient greek (to 1453) \u0027ἀρχαιογράφος\u0027 (the writing of antiquities)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Discipline for publishing treatises of any antiquity or antiquities\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1907\u0027\u0027, Sir Norman Lockyer, \u0027Nature\u0027, [http://books.google.com/books?id\u003dHogCAAAAIAAJ\u0026amp;hl\u003dsv\u0026amp;pg\u003dPA28\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dfalse page 285\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The institute grants the degree of doctor of archæology or \u0027\u0027archæography\", \"priority\":4}]}, \"synonyms\":{}}");

	add("archaeolinguistics", "{\"term\":\"archaeolinguistics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|archaeo|linguistics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the distant human past using archaeological and linguistic evidence together to reconstruct aspects of past cultures\", \"priority\":1}]}, \"synonyms\":{}}");

