	add("archaeology", "{\"term\":\"archaeology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀρχαιολογία\u0027 (antiquarian lore, ancient legends, history) from \u0027ἀρχαῖος\u0027 (primal, old, ancient) + \u0027λόγος\u0027 (speech, oration, study)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the past by excavation and analysis of its material remains\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027: Chris Horrocks\u0026lt;!-- illustrated by Zoran Jevtic --\u0026gt;, \u0027Introducing Foucault\u0027, pages 36,\u0026lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt; 63,\u0026lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt; and 64\u0026lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt; (Totem Books, Icon Books; ISBN 1840460865\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt; He first presented a complementary\u0026lt;!-- [sic] --\u0026gt; thesis on the Enlightenment philosopher \u0027\u0027Immanuel Kant\u0027\u0027 (1724–1804), in which he used the term “\u0027\u0027archaeology\u0027\u0027” for the first time, and which indicated the period of history to which he was constantly to return\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt; The latent grid of knowledge which organizes every scientific discourse and defines what can or cannot be thought scientifically — the process of uncovering these levels Foucault calls \u0027\u0027\u0027archaeology\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{3}\u0026lt;/sup\u0026gt; “\u0027\u0027Archaeology\u0027\u0027”, as the investigation of that which renders necessary a certain form of thought, implies an excavation of unconsciously organized sediments of thought. Unlike a \u0027\u0027history of ideas\u0027\u0027, it doesn’t assume that knowledge accumulates towards any historical conclusion. \u0027\u0027Archaeology\u0027\u0027 ignores individuals and their histories. It prefers to excavate \u0027\u0027impersonal\u0027\u0027 structures of knowledge.\u0026lt;br/\u0026gt;\u0027\u0027Archaeology\u0027\u0027 is a task that \u0027doesn’t\u0027 consist of treating discourse as signs referring to a real content like madness. It treats discourses, such as medicine, as \u0027\u0027practices\u0027\u0027 that form the objects of which they speak\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"the actual excavation, examination, analysis and interpretation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The building\u0027s developers have asked for some \u0027\u0027archaeology\u0027\u0027 to be undertakem\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the actual remains together with their location in the stratigraphy\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027archaeology\u0027\u0027 will tell us which methods of burial were used by the Ancient Greeks\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"the academic subject; in the USA: one of the four sub-disciplines of anthropology\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"She studied \u0027\u0027archaeology\u0027\u0027 at Edinburgh University\", \"priority\":11}]}, \"synonyms\":{}}");

