	add("archaic", "{\"term\":\"archaic\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027archaism\u0027 (ancient or obsolete phrase or expression) or from French \u0027archaïque\u0027 () ultimately from Ancient greek (to 1453) \u0027ἀρχαικός\u0027 (old-fashioned) from \u0027ἀρχαῖος\u0027 (from the beginning, antiquated, ancient, old) from \u0027ἀρχή\u0027 (beginning, origin) from \u0027ἄρχω\u0027 (i am first)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A general term for the prehistoric period intermediate between the earliest period (‘[http://en.wikipedia.org/wiki/Paleo-Indian Paleo-Indian]’, ‘Paleo-American’, ‘American‐paleolithic’, \u0027\u0026amp;c\u0027.) of human presence in the Western Hemisphere, and the most recent prehistoric period (‘Woodland’, etc.).\u0026lt;!-- needs links to Wikipedia entries --\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, Wiley, Gordon R., and Philip Phillips, \u0027Method and Theory in American Archaeology\u0027, University of Chicago Press, Chicago, page\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Archaic\u0027\u0027 Stage [...] the stage of migratory hunting and gathering cultures continuing into environmental conditions approximately those of the present\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A member of) an archaic variety of \u0027Homo sapiens\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027The Human Lineage\u0027, page 432\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"prefer the third explanation for the advanced-looking features of Neandertals (Chapter 7) and the Ngandong hominins (Chapter 6), but they have had little to say about the post-Erectine \u0027\u0027archaics\u0027\u0027 from China\", \"priority\":6}]}, \"synonyms\":{}}");

