	add("archangel", "{\"term\":\"archangel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|archangele}}, from Latin {{m|la|archangelus}}, from Ancient greek (to 1453) {{m|grc|ἀρχάγγελος}} from Ancient Greek prefix {{m|grc|αρχ-}} + \u0027ἄγγελος\u0027 (messenger) Surface analysis {{prefix|arch|angel|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A powerful angel that leads many other angels, but is still loyal to a deity. (Judeo-Christian examples: Gabriel, Michael, Raphael, Uriel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In Christian angelology, an archangel is an angel from the third level or \u0027\u0027choir\u0027\u0027 of angels, ranked above virtues and below powers\", \"priority\":2}]}, \"synonyms\":{}}");

