	add("archbishopdom", "{\"term\":\"archbishopdom\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|*archebischopdom}}, from Old english (ca. 450-1100) {{m|ang|ærċebiscopdōm||archiepiscopal dignity; archbishopric}}, equivalent to {{suffix|archbishop|dom|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The realm, sphere, domain, office, or jurisdiction of an archbishop; archbishopric\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1855\u0027\u0027, A general index to the publications of the Parker Society - Page 567\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"some call it the sacrament of priesthood, of bishopdom, or of \u0027\u0027archbishopdom\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Josefa Nina Lieberman, Beaumont, \u0027He came to Cambridge\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In the not too distant past Salzburg had been an \u0027\u0027Archbishopdom\u0027\u0027 ruled by her archbishops\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Erik Tiberg, \u0027Moscow, Livonia and the Hanseatic League: 1487-1550 - Page 191\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The fines of 120 Mark remained unpaid, as the principals were said to have refused. One can understand that the three agents fled into the adjacent \u0027\u0027archbishopdom\u0027\u0027 where they could not be reached by the guardians of Riga\u0027s law\", \"priority\":7}]}, \"synonyms\":{}}");

