	add("archdemon", "{\"term\":\"archdemon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|arch|demon|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chief demon; an archdevil\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archdevil", "{\"term\":\"archdevil\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|arch|devil|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chief or reigning devil\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A program, or part of a program, which is not invoked explicitly but lies dormant waiting for some event\", \"priority\":2}]}, \"synonyms\":{}}");

	add("archdiocese", "{\"term\":\"archdiocese\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|arch|t1\u003dchief, main|diocese|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In Christian denominations, the area administered by an archbishop\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archdruid", "{\"term\":\"archdruid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|arch|druid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chief druid\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archebiosis", "{\"term\":\"archebiosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The origination of living matter from non-living; abiogenesis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archeometry", "{\"term\":\"archeometry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The application of the various techniques of science to archeology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archer", "{\"term\":\"archer\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"from Middle english (1100-1500) from Old french (842-ca. 1400) \u0027archier\u0027 from \u0027arcarius\u0027 \u0027alteration of\u0027 \u0027arcuarius\u0027 from Latin \u0027arcus\u0027 (bow)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who shoots an arrow from a bow or a bolt from a crossbow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The bishop in chess\", \"priority\":2}]}, \"synonyms\":{}}");

	add("archeress", "{\"term\":\"archeress\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|archer|ess|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female archer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1878\u0027\u0027, John Berwick Harwood, \u0027Helena, lady Harrogate\u0027, page 11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"looking very much as they must have looked when Queen Elizabeth deigned to show her skill as an archeress, to the detriment of the dappled deer in the wide park beyond\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1882\u0027\u0027, Catherine Parr Traill, \u0027Lost in the Backwoods\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Catharine was a tolerable \u0027\u0027archeress\u0027\u0027 with the long-bow, and the hut was now seldom without game of one kind or other\", \"priority\":5}]}, \"synonyms\":{}}");

	add("archerfish", "{\"term\":\"archerfish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|archer|fish|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the species of fish in the \u0027\u0027 (toxotes) family, who prey on small animals near to the surface of a water by shooting them with water from their mouths\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archery", "{\"term\":\"archery\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027archerie\u0027 from \u0027archier\u0027 (archer) Equivalent to {{suffix|archer|ery|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice or sport of shooting arrows with a bow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A group of archers\", \"priority\":2}]}, \"synonyms\":{}}");

	add("archetype", "{\"term\":\"archetype\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027architipe\u0027 (French \u0027archétype\u0027 , from Latin \u0027archetypum\u0027 from Ancient greek (to 1453) \u0027ἀρχέτυπον\u0027 (pattern, model) neuter of \u0027ἀρχέτυπος\u0027 (first-moulded) from \u0027ἀρχή\u0027 (first, origin ) + \u0027τύπος\u0027 (sort, type, press)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An original model of which all other similar persons, objects, or concepts are merely derivative, copied, patterned, or emulated; a prototyp\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A character, story, or object that is based on a known character, story, or object\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An ideal example of something; a quintessence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"According to the Swiss psychologist Carl Jung, a universal pattern of thought, present in an individual\u0027s unconscious, inherited from the past collective experience of humanity\", \"priority\":4}]}, \"synonyms\":{}}");

	add("archeus", "{\"term\":\"archeus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀρχαῖος\u0027 (original, ancient)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The vital principle or force believed by the Paracelsians to be responsible for alchemical reactions within living bodies, and hence for the growth and continuation of life\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1662\u0027\u0027, \u0027s:An Antidote Against An Antidote Against Atheism\u0027, Book II, A Collection of Several Philosophical Writings of Dr. Henry More, p. 68\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot; it must be the \u0027Modus\u0027 of some other Substance latitant in the \u0027fluid\u0027 Matter, and really distinguishable from it; which is either the \u0027Soul\u0027, or some seminal Form or \u0027\u0027\u0027Archeus\u0027\u0027\u0027, as the \u0027Chymist\u0027 calls it \u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Roy Porter, \u0027Flesh in the Age of Reason\u0027 (Penguin 2004, p. 56\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Willis rejected not just scholasticism\u0027s ‘substantial forms’ but Paracelsus\u0027s ‘\u0027\u0027archeus\u0027\u0027’ doctrine as well\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0027The Devil\u0027s Doctor\u0027, Arrow 2007, p. 250\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"But Paracelsus\u0027 theory of the \u0027\u0027archeus\u0027\u0027 and the alchemy of life inevitably led him into deeper waters\", \"priority\":7}]}, \"synonyms\":{}}");

	add("archfiend", "{\"term\":\"archfiend\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|arch|fiend|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a diabolically evil person\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archfoe", "{\"term\":\"archfoe\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|arch|foe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"archenem\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archicerebellum", "{\"term\":\"archicerebellum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|archi|cerebellum|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The oldest part of the cerebellum in evolutionary terms; the vestibulocerebellum\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archicortex", "{\"term\":\"archicortex\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|archi|cortex|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Part of the allocortex, specifically three layered hippocampal cortexes necessary for hippocampus formation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archie", "{\"term\":\"archie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A diminutive of the male given name \u0027\u0027Archibald\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archiepiscopality", "{\"term\":\"archiepiscopality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The rank or dignity of an archbishop; archiepiscopacy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archimandrite", "{\"term\":\"archimandrite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{borrowing|fr|archimandrite|lang\u003den}}, from Latin {{m|la|archimandrīta}}, from late Ancient greek (to 1453) \u0027ἀρχιμανδρίτης\u0027 from \u0027ἀρχι-\u0027 (highest) + \u0027μάνδρα\u0027 (enclosure, monastery)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The superior of a large monastery, or group of monasteries, in the Orthodox Church\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An honorary title sometimes given to a monastic priest\", \"priority\":2}]}, \"synonyms\":{}}");

	add("archimedes", "{\"term\":\"archimedes\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027ἀρχιμήδης\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Ancient Greek mathematician, physicist and enginee\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large lunar impact crater on the eastern edges of the Mare Imbrium\", \"priority\":2}]}, \"synonyms\":{}}");

	add("archimime", "{\"term\":\"archimime\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Latin \u0027archimimus\u0027, from Ancient greek (to 1453) \u0027ἀρχίμῖμος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The chief jester or mimic who would imitate the dead person as part of ancient Roman funeral processions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1658\u0027\u0027: The \u0027\u0027\u0027Archimime\u0027\u0027\u0027 or \u0027Jester\u0027 attending the Funerall train, and imitating the speeches, gesture, and manners of the deceased, was too light for such solemnities — Sir Thomas Browne, \u0027Urne-Burial\u0027 (Penguin 2005, p. 37\", \"priority\":2}]}, \"synonyms\":{}}");

	add("archipallium", "{\"term\":\"archipallium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|archi|pallium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The oldest region of the brain\u0027s pallium, often considered contiguous with the olfactory cortex, but varying among species. In humans, the archipallium makes up the hippocampus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archipelago", "{\"term\":\"archipelago\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Italian\"], \"text\":\"From Italian \u0027arcipelago\u0027 (the chief sea, the aegean sea) from Ancient greek (to 1453) {{prefix|ἀρχι|t1\u003dleading|πέλαγος|t2\u003dsea|lang\u003dgrc|nocat\u003dyes}}. The Aegean Sea|Aegean (\u0027the Arcipelago\u0027) is a sea with many islands; by extension, the term \u0027an Arcipelago\u0027 at first referred to any sea with many islands, then to the islands themselves.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of islands\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, Herman Melville, \u0027Moby-Dick\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For many years past the whaleship has been the pioneer in ferreting out the remotest and least known parts of the earth. She has explored seas and \u0027\u0027archipelagoes\u0027\u0027 which had no chart, where no Cook or Vancouver had ever sailed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something scattered around like an archipelago\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Gulag Archipelago\", \"priority\":5}]}, \"synonyms\":{}}");

	add("archiphoneme", "{\"term\":\"archiphoneme\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|archi|phoneme|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A unit representing two or more underlying phonemes, where the distinction between them has been neutralized under certain conditions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("architect", "{\"term\":\"architect\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\"], \"text\":\"Middle french (ca. 1400-1600) \u0027architecte\u0027 from Ancient greek (to 1453) \u0027ἀρχιτέκτων\u0027 (master builder) from \u0027ἀρχι-\u0027 (chief) + \u0027τέκτων\u0027 (builder)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A professional who designs buildings or other structures, or who prepares plans and superintends construction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Plato made the causes of things to be matter, ideas, and an efficient \u0027\u0027architect\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person who plans, devises or contrives the achievement of a desired result\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Peisistratus was the first \u0027\u0027architect\u0027\u0027 of the Iliad and the Odyssey\", \"priority\":4}]}, \"synonyms\":{}}");

	add("architectress", "{\"term\":\"architectress\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|architect|ess|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female architect\", \"priority\":1}]}, \"synonyms\":{}}");

	add("architecture", "{\"term\":\"architecture\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{borrowing|fr|architecture|lang\u003den}}, from Latin {{m|la|architectūra}}. Originally from \u0027architect\u0027, from Ancient greek (to 1453) \u0027ἀρχιτέκτων\u0027 (architect) meaning chief builder (principal craftsman).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The art and science of designing and managing the construction of buildings and other structures, particularly if they are well proportioned and decorated\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027architecture\u0027\u0027 throughout NYC is amazing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The profession of an architect\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any particular style of building design\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Construction, in a more general sense; frame or structure; workmanship\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Tyndal\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027architecture\u0027\u0027 of grasses, plants, and tree\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Burne\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"the formation of the first earth being a piece of divine \u0027\u0027architecture\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A unifying structure\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A specific model of a microchip or CPU\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The Intel \u0027\u0027architectures\u0027\u0027 have more software written for them\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The structure and design of a system or product\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Prof P.C.P. Bhatt, \u0026lt;tt\u0026gt;(nptel.iitm.ac.in)\u0026lt;/tt\u0026gt; [http://nptel.iitm.ac.in/courses/Webcourse-contents/IISc-BANG/Operating%20Systems/pdf/Lecture_Notes/Mod%2014_LN.pdf Module 14: Unix Kernel Architecture\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The kernel runs the show, i.e. it manages all the operations in a Unix flavored environment. The kernel architecture must support the primary Unix requirements. These requirements fall in two categories namely, functions for process management and functions for file management (files include device files). Process management entails allocation of resources including CPU, memory, and offers services that processes may need. The file management in itself involves handling all the files required by processes, communication with device drives and regulating transmission of data to and from peripherals\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027architecture\u0027\u0027 of the company\u0027s billing system is designed to support its business goals\", \"priority\":16}]}, \"synonyms\":{}}");

	add("architourism", "{\"term\":\"architourism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|architecture|tourism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Tourism involving seeing buildings and other architectural works\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0026quot;[http://findarticles.com/p/articles/mi_qa5361/is_3_69/ai_n29093221/ The Wright stuff: a reborn Frank Lloyd Wright masterpiece attracts visitors to an Oklahoma oil town]\u0026quot;, \u0027Journal of Property Management\u0027, May/June 2004\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Its luxury loft rooms attract international visitors seeking the \u0026quot;\u0027\u0027architourism\u0027\u0027\u0026quot; experience of staying in the only hotel housed in a Wright structure\", \"priority\":3}]}, \"synonyms\":{}}");

	add("archivalism", "{\"term\":\"archivalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|archival|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The keeping of archives\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archive", "{\"term\":\"archive\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027archives\u0027 from Latin {{m|la|archīvum}}, from Ancient greek (to 1453) \u0027ἀρχεῖον\u0027 (town hall)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A place for storing earlier, and often historical, material. An archive usually contains documents (letters, records, newspapers, etc.) or other types of media kept for historical interest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The material so kept, considered as a whole (compare archives\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027archive\u0027\u0027 of Old High German language texts is the most extensive in Britain\", \"priority\":3}]}, \"synonyms\":{}}");

	add("archiver", "{\"term\":\"archiver\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|archive|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, archives\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archivist", "{\"term\":\"archivist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is in charge of, or performs the task of creating, collecting, cataloguing, and organising, archives\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The billionaire\u0027s will established a trust to create a staff of \u0027\u0027archivists\u0027\u0027 that would chronicle and preserve his rise to prominence\", \"priority\":2}]}, \"synonyms\":{}}");

	add("archmagician", "{\"term\":\"archmagician\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|arch|magician|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very powerful magician\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archmodernist", "{\"term\":\"archmodernist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|arch|modernist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A leading modernist\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archnemesis", "{\"term\":\"archnemesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|arch|nemesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chief\", \"priority\":1}]}, \"synonyms\":{}}");

	add("archon", "{\"term\":\"archon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἄρχων\u0027 a noun use of the present participle of \u0027ἄρχειν\u0027 (to rule)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chief magistrate of ancient Athens\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027: Hated by the archons of Athens for his fearless condemnation of municipal graft, he was hypocritically arraigned on a charge of corrupting Athenian youth. (Burgess, \u0027Earthly Powers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A ruler, head of state or other leader\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027: But neither the midwife’s lore nor the caudlectures saved him from the archons of Sinn Fein and their noggin of hemlock. (Joyce, \u0027Ulysses\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A supernatural being subordinate to the Demiurge\", \"priority\":5}]}, \"synonyms\":{}}");

