	add("archonship", "{\"term\":\"archonship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|archon|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The rank or office of an archon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"William Mitfor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"which carries us back to the \u0027\u0027archonship\u0027\u0027 of Chaerondas for the date of the battle\", \"priority\":3}]}, \"synonyms\":{}}");

	add("archontes", "{\"term\":\"archontes\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἄρχοντες\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1930\u0027\u0027, w:Georges Georges Bataille, \u0027Base Materialism and Gnosticism\u0027, quoted in\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Aryeh Kasher, \u0027The Jews in Hellenistic and Roman Egypt: the struggle for equal rights‎\u0027 (Mohr Siebeck, ISBN 978‒3‒16‒144829‒4), [http://books.google.co.uk/books?id\u003du3WIYJV1w_YC\u0026amp;pg\u003dPA140\u0026amp;dq\u003darchontes page 140\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He may however have been one of the local \u0027\u0027\u0027archontes\u0027\u0027\u0027, who are mentioned in another document (\u0027CPJ\u0027, II 432, see below) as representing the community in regard to public water consumption\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It was translated by the editor, Fuks, as “from the \u0027\u0027\u0027archontes\u0027\u0027\u0027 of the synagogue of the Theban Jews” which implies that the Thebans had their own leadership, and in that case it is surprising that no \u0027\u0027\u0027archontes\u0027\u0027\u0027 are mentioned in connection with the local synagogue (line 60\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Sally McKee, \u0027Uncommon dominion: Venetian Crete and the myth of ethnic purity\u0027 (University of Pennsylvania Press, ISBN 978‒0‒8122‒3562‒3), [http://books.google.co.uk/books?id\u003dPkEJCNNS3PwC\u0026amp;pg\u003dPA69\u0026amp;dq\u003darchontes page 69\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027archontes\u0027\u0027’ resistance to the Venetians arose far more from a sense of threatened hegemony than from a sense of national violation, as evidenced in part by the Greek nobles’ inability ever to unite in coalition against the occupiers. Their anger instead arose out of their being dispossessed of their lands and status. In the process of consolidating their hold of the island, the Venetian authorities had confiscated all the land that had belonged to the Byzantine imperial fisc and to the Greek \u0027\u0027archontes\", \"priority\":6}]}, \"synonyms\":{}}");

